import React, {Component} from 'react';
import Linkify from 'react-linkify';

class DisplayCostume extends Component {
    constructor(props){
        super(props);
    }

    render(){
        let costumesTable = this.props.costumeData.map(
            function (costumeData, index){
                return(
                    <div className="medium-12 columns" key={index}>
                    <b>{this.props.name}</b>
                    <Linkify>{costumeData.costumes}</Linkify>
                    <br/>
                    </div>
                )
            }, this);

    return (
        <div>{costumesTable}</div>
    );
    }
}

export default DisplayCostume;
